// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract StringTest{
    function reverseString(string memory _str)public pure returns(string memory)  {
/*        // 将字符串转换为 bytes 类型
        bytes memory strBytes = bytes(_str);
        bytes memory reversed = new bytes(strBytes.length);  // new一个长度为strBytes.length的bytes数组准备用来存反转后的bytes


        for(uint i = 0;i < strBytes.length; i++){
            reversed[i] = strBytes[strBytes.length-1-i];
        }*/

        bytes memory strBytes = bytes(_str);
        uint length = strBytes.length;

        // 如果字符串为空或只有一个字符，直接返回
        if (length <= 1) {
            return _str;
        }

        bytes memory reversed = new bytes(length);


        // 使用两个指针同时移动，减少计算
        for(uint i = 0 ;i< length;i++){
            reversed[i] = strBytes[length - 1 - i];
        }
        return string(reversed);
    }
}

contracts/TransferDemo.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TransferDemo {
    address public owner;
    mapping(address => uint256) public balances;
    uint256 public contractBalance;

    event Deposit(address indexed from, uint256 amount);
    event Withdraw(address indexed to, uint256 amount);
    event Transfer(address indexed from, address indexed to, uint256 amount);

    constructor() {
        owner = msg.sender;
    }

    // 存款到合约
    function deposit() public payable {
        require(msg.value > 0, "Amount must be greater than 0");
        balances[msg.sender] += msg.value;
        contractBalance += msg.value;
        emit Deposit(msg.sender, msg.value);
    }

    // 从合约取款
    function withdraw(uint256 amount) public {
        require(balances[msg.sender] >= amount, "Insufficient balance");
        require(address(this).balance >= amount, "Contract insufficient balance");

        balances[msg.sender] -= amount;
        contractBalance -= amount;

        payable(msg.sender).transfer(amount);
        emit Withdraw(msg.sender, amount);
    }

    // 转账给其他用户
    function transferTo(address payable to, uint256 amount) public {
        require(balances[msg.sender] >= amount, "Insufficient balance");

        balances[msg.sender] -= amount;
        balances[to] += amount;

        emit Transfer(msg.sender, to, amount);
    }

    // 直接ETH转账
    function directTransfer(address payable to) public payable {
        require(msg.value > 0, "Amount must be greater than 0");
        to.transfer(msg.value);
        emit Transfer(msg.sender, to, msg.value);
    }

    // 获取用户余额
    function getBalance(address user) public view returns (uint256) {
        return balances[user];
    }

    // 获取合约ETH余额
    function getContractBalance() public view returns (uint256) {
        return address(this).balance;
    }

    // 接收ETH的回退函数
    receive() external payable {
        deposit();
    }
}

contracts/Voting.sol.content:
pragma solidity ^0.8.0;

contract Voting{
    // mapping 来存储候选人的得票数
    mapping(string =>uint256) public candidateVotes;

    // 存储所有候选人的数组，用于重置功能
    string[] private candidates;

    // 投票事件，用于记录投票历史
    event Voted(address indexed voter,string candidate, uint256 newVoteCount);

    // 重置事件
    event VotesReset(address indexed resetBy);

    /**
     * @dev 投票给某个候选人
     * @param candidate 候选人名称
     */
    function vote(string memory candidate)public  {
        require(bytes(candidate).length>0,"Candidate name cannot be empty");

        // 如果是第一次给这个候选人投票，将其添加到候选人数组
        if(candidateVotes[candidate] == 0){
            candidates.push(candidate);
        }

        candidateVotes[candidate]++;
        emit Voted(msg.sender,candidate,candidateVotes[candidate]);
    }

    /**
     * @dev 获取某个候选人的得票数
     * @param candidate 候选人名称
     * @return 该候选人的得票数
     */

    function getVotes(string memory candidate)public view returns(uint256){
        return  candidateVotes[candidate];

    }
    /**
     * @dev 重置所有候选人的得票数
     */
    function resetVotes() public  {
        for(uint256 i=0;i<candidates.length;i++){
            candidateVotes[candidates[i]] = 0;
        }
        emit VotesReset(msg.sender);
    }
    /**
     * @dev 获取所有候选人列表（额外功能）
     * @return 包含所有候选人名称的数组
     */
    function getAllCandidates()public view returns(string[]  memory)  {
        return candidates;
    }

    /**
     * @dev 获取候选人总数（额外功能）
     * @return 候选人总数
     */
    function getCandidateCount() public view  returns(uint256) {
        return candidates.length;
    }

}

